def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i, ratio in enumerate(ratios):
        if ratio < 0.3:
            priorities[i] = 1 / (1 + np.exp(-10 * (ratio - 0.3))) + 0.1
        elif ratio >= 0.3 and ratio < 0.6:
            priorities[i] = 1 / (1 + np.exp(-5 * (ratio - 0.45))) + 0.2
        elif ratio >= 0.6 and ratio < 1:
            priorities[i] = 1 / (1 + np.exp(-3 * (ratio - 0.8))) + 0.3
        else:
            priorities[i] = 1 / (1 + np.exp(-2 * (ratio - 1.25))) + 0.4

        if i % 3 == 0:
            priorities[i] += 0.5
        elif i % 3 == 1:
            priorities[i] -= 0.3
        else:
            priorities[i] += 0.1

    return priorities
